【商品説明】<br>電子レンジでチンするだけで、心地よい温かさ。首や肩をやさしく包み、温めてラクにします。<br><br>商品サイズ：120×235×75<br><br>成分：水、ゲル化剤、色素<br><br>原材料・材質：カバー素材：ポリエステル<br><br>ご使用上の注意等：用途以外には使用しないでください。<br>やけどを防止するため、以下の点にご注意ください。<br>･長時間同じ部位にあてないようにしてください。低温やけどの恐れがあります。なお、自覚症状をともなわないで低温やけどになる場合もありますのでご注意ください。<br>･肌に直接使用せず、必ず専用カバーに入れて衣類の上から使用してください。<br>･肌の弱い方、皮膚に異常のある部位や熱をおびている部位には使用しないでください。<br>･乳幼児やペット、泥酔時や就寝中には使用しないでください。身体のご不自由な方などがご使用になる場合は、まわりの方が十分にご注意ください。<br>･熱いと感じたら、ただちに使用を中止してください。糖尿病等で血行障害のある方は、熱さを感じにくいことがありますので特にご注意ください。<br>･カイロなどの発熱体を使用している上からのご使用はおやめください。<br>医療機器ではありません。治療目的で使用しないでください。<br>落としたりぶつけたりしないでください。<br>本品は食べられません。<br>万一、破れて中身が衣類等についた場合はすぐに水洗いしてください。<br>保冷用ではありません。冷凍・冷蔵しないでください。<br>電子レンジ以外での加熱はできません。<br>用途以外には使用しないでください。<br>首しまり事故防止のため、使用中は製品を引っぱったり、引っかけたりしないように注意してください。<br><br>原産国：日本＆中国<br>商品区分：湯たんぽ・その他<br>JANコード：4902407330192<br><br><br><br>広告文責：アットライフ株式会社<br>TEL 079-280-2113<br>※商品パッケージは変更の場合あり。<br>メーカー欠品または完売の際、キャンセルをお願いすることがあります。ご了承ください。<style>
