レンジでゆたぽん 首肩用 ふわふわカバー付<br>ブランド：ゆたぽん<br>販売・製造元：白元<br><br>電子レンジでチンするだけで、心地よい温かさになる湯たんぽです。<br>首や肩にやさしくフィットするジェルタイプです。<br>繰り返しお使いいただけます。<br>●温かさは約30分持続します。<br>(外気温や<br><br>使用方法<br>により持続時間は異なります。<br>)●洗える専用ふわふわカバー付き。<br> <br>用途肩や首の保温用 <br><br>使用方法<br>【<br><br>使用方法<br>】(1)本体は2重袋になっています。<br>外袋は破らずにご使用ください。<br>(2)加熱前に電子レンジ皿の汚れをよくふき取ってください。<br> ※本品に汚れが付着すると、その部分だけが異常に加熱され、袋が溶けて破れることがあります。<br>(3)中心から折り曲げ、本体の重なりが少なくなるようにV字にずらして電子レンジに入れ、電子レンジの中央に入れて加熱します。<br> ※ジェルの片寄りがないよう手でもむなどして全体的に均一にしてから加熱してください。<br> ●ターンテーブル型の電子レンジを使用する場合は、加熱中、ターンテーブルが回っていることを確認してください。<br> ●必ず電子レンジ機能で加熱し、オーブン機能、スチーム機能では加熱しないでください。<br> ●業務用電子レンジでは加熱しないでください。<br>(4)本体を専用カバーに入れ、衣類の上から肩にのせてください。<br>【加熱時間】●500W：2分30秒●600W：2分●1000W：1分30秒●温かさが足りない場合：本体を手でもみほぐした後、温かさを確認しながら10-20秒ずつ追加加熱。<br>※加熱中は電子レンジのそばを離れないでください。<br>※表示の加熱時間は15度の室温においた本体を45度まで温める標準的な加熱時問です。<br>(45度はお風呂より少し熱い温度です。<br>) <br><br>使用上の注意<br>(1)用途以外には使用しないでください。<br>(2)やけどを防止するため、以下の点にご注意ください。<br> ●長時間同じ部位にあてないようにしてください。<br>低温やけどの恐れがあります。<br>なお、自覚症状をともなわないで低温やけどになる場合もありますのでご注意ください。<br> ●肌に直接使用せず、必ず専用カバーに入れて使用してください。<br> ●肌の弱い方、皮膚に異常のある部位や熱をおびている部位には使用しないでください。<br> ●乳児やペット、泥酔時には使用しないでください。<br>幼児や身体のご不自由な方などがご使用になる場合は、まわりの方が十分にご注意ください。<br> ●熱いと感じたら、ただちに使用を中止してください。<br>糖尿病等で血行障害のある方は、熱さを感じにくいことがありますので特にご注意ください。<br>(3)医療機器ではありません。<br>治療目的で使用しないでください。<br>(4)落としたりぶつけたりしないでください。<br>(5)本品は食べられません。<br>(6)万一、破れて中身がシーツ等についた場合はすぐに水洗いしてください。<br>(7)保冷用ではありません。<br>冷凍・冷蔵しないでください。<br>(8)電子レンジ以外での加熱はできません。<br>(9)用途以外には使用しないでください。<br>(10)首しまり事故防止のため、使用中は製品を引っぱったり、引っかけたりしないように注意して下さい。<br> 加熱にあたっての注意(1)レンジ出力および加熱時間を必ず守って使用してください。<br> ※加熱しすぎると中袋が破れ、高温の中身が漏れ出たり飛び散ったりしてやけどの恐れがあります。<br>(2)加熱中、本体がふくれたり、中袋が破れて赤いジェルが出てきた場合は、すぐに電子レンジのスイッチを切り、十分に時間をおいて、冷ましてから電子レンジの扉を開けてください。<br>(3)本体が温かい時に再加熱する場合は、温かさを確認しながら10-20秒ずつ加熱してください。<br>(4)自動モード(オート加熱、おまかせ加熱など)は使用しないでください。<br>過剰加熱になる恐れがあります。<br>(5)長期間の使用や使用状況により、袋の強度が低下する可能性がありますので、本体に亀裂、破れなど異常が見られた場合は、廃棄し、新しい商品にお取替えください。<br>(6)表示通り加熱しても、本体表面が部分的に高温になる場合がありますので、電子レンジから取り出す時には注意してください。<br>(7)カバーに入れたまま電子レンジで加熱しないでください。<br>(8)子供だけで加熱、取り出しをさせないでください。<br> 保管上の注意・廃棄方法(1)使用しない時は、直射日光をさけ、乳幼児の手の届かない涼しい所に保管してください。<br>(2)本体は、2重袋のままプラスチックゴミとして捨ててください。<br>(市区町村の区分に従って捨ててください。<br>) 品質表示●成分：水、ゲル化剤、色素●カバー素材：ポリエステル<br> 原産国日本：本体　中国：カバー <br><br>お問い合わせ先<br>株式会社白元 お客様相談室TEL：03-5681-7691受付時間：9：00-17：00(土、日、祝日を除く) 湯たんぽ全部とは湯たんぽ(ゆたんぽ)は、陶器や金属、プラスチック、天然ゴムなどの容器に湯を注ぎ、栓をして使用する暖房器具です。<br>布団の中に入れて足を暖めたり、椅子の背もたれや足先に置いて、足や腰を暖めたりしてお使いいただけます。<br>ポリエチレン製のポリ湯たんぽ、昔ながらのトタン湯たんぽ、ゴツゴツしないソフト湯たんぽなどいろいろなタイプを取り揃えています。<br>電子レンジであたためるタイプのゆたんぽも人気です。<br><br>衛生医療／温熱用具／湯たんぽ／電子レンジタイプ<br>JANコード： 4902407330192<br><br>CS：10<br>広告文責：アットライフ株式会社<br>TEL 079-280-2113<br>※商品パッケージは変更の場合あり。<br>メーカー欠品または完売の際、キャンセルをお願いすることがあります。ご了承ください。<br><style type="text/css">
